import ReactPDF , { Document, Page, Text, View, StyleSheet } from '@react-pdf/renderer'
export default function PDFRender() {
  return (
    <div>
        <Document>
            <Page>
                <Text>welcome</Text>
            </Page>
        </Document>
    </div>
  )
}
